catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
   if (isLoading || newValue == '') {
      return;
   }

   //Type appropriate comment here, and begin script below
   var upldFile = new GlideAjax('excelToMRVSUtils');
   upldFile.addParam('sysparm_name', 'excelToMRVS');
   upldFile.addParam('sysparm_attachment', g_form.getValue('upload_excel'));
   upldFile.getXML(returnResponse);

   function returnResponse(response) {
	var ret = response.responseXML.documentElement.getAttribute('answer');
	g_form.clearValue('multi_row_variable_set');
	g_form.setValue('multi_row_variable_set', ret);
}

}
